import React from 'react'

const Header = () => {
    function NameChange(){
        const names=["Money1","Honey","Bunny","Sunny"];
        const poss=Math.floor(Math.random()*4);
        return (names[poss]);
        } 
    return(
      <>
      <h1>To do List</h1>
      <p>{NameChange()} Hi</p>
      </> 
    )
}

export default Header
